export const PortalSVG = ( siteUrl: string ): string =>
{
    const siteID = encodeURIComponent( btoa( siteUrl ) )
    return `<svg viewBox="0 0 100 100"><image href="https://fetch-favicon.fly.dev/favicon/${ siteID }" height="100" width="100" /></svg>`
}

